import Header from "./Header";
import Footer from "./Footer";



function ConfirmedBooking(){
    const navigate = useNavigate();

    setTimeout(function(){
        navigate("")
    }, 3000);

    return(
        <>
        <Header />
        <p>Booking Confirmed!!</p>
        <Footer />
        </>
    )
}

export default ConfirmedBooking;
